])
const show = ref(false)
const routerTo = (url) => {
  router.push(url)
}

const scroll = ref(0)
// 实时滚动条高度
const scrollTop = () => {
  scroll.value = document.documentElement.scrollTop || document.body.scrollTop;
}
const scrollToAnchor = (id) => {
  const headerOffset = 50; // 你的固定头部高度
  const el = document.getElementById(id);
  if (el) {
    const offsetTop = el.getBoundingClientRect().top + window.pageYOffset - headerOffset;
    window.scrollTo({
      top: offsetTop,
      behavior: 'smooth'
    });
  }
  show.value = false; // 关闭菜单等行为
};
onMounted(() => {
  window.addEventListener('scroll', scrollTop, true)
})
